import React, {useState} from "react";
import Note from "./components/note.component";

const App = (props) => {

  const [notes, setNotes] = useState(props.notes)

  return (
    <div>
      <h1>Notes</h1>
      <ul>
        {props.notes.map(note => 
            <Note key={note.id} note={note} />
        )}
      </ul>
    </div>
  )
}

export default App;
